import s from './Components/StyleApp/app.module.css'
import {BrowserRouter, Route} from 'react-router-dom';
import Profile from "./Components/Profile/Profile";
import Header from "./Components/Header/Header";
import Footer from "./Components/Footer/Footer";
import About from "./Components/About/About";
import PizzaOrderContainer from "./Components/PizzaOrder/PizzaOrderContainer";
import SnekOrderContainer from "./Components/SnekOrder/SnekOrderContainer";
import DrinkOrderContainer from "./Components/DrinkOrder/DrinkOrderContainer";


function App(props) {
    return (

        <BrowserRouter path="/profile">
            <div className={s.App}>
                <Header/>
                <Route path="/about" render={() => <About
                />}/>
                <Route path="/profile" render={() => <Profile
                />}/>
                <Route path="/pizza/:id" render={() => <PizzaOrderContainer/>}/>

                <Route path="/sneks/:id" render={() => <SnekOrderContainer/>}/>

                <Route path="/drink/:id" render={() => <DrinkOrderContainer/>}/>


                <Footer/>
            </div>
        </BrowserRouter>

    );
}

export default App;
